import React from 'react';
import {AuthHeader, ContentLayout} from "@shared/ui";
import {LoginForm, SocialAuth, ValidationForm} from "@widgets";
import {loginValidator} from "@shared/lib";

export const LoginPage = () => {
    return (
        <ContentLayout center>
            <AuthHeader>
                Добро пожаловать!
                <br/>
                <span>Авторизуйтесь для доступа к сервису</span>
            </AuthHeader>

            {/*<LoginForm />*/}
            <ValidationForm validator={loginValidator} config={{}} />

            <SocialAuth />
        </ContentLayout>
    );
};
